import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import { Navbar, Nav, Button } from 'react-bootstrap';
import './index.css'; 

// Navbar component
const Nav_bar = () => {
    return (
        <Navbar expand='lg' bg="light" className="mb-4">
            <Navbar.Brand>Ezeiyoke Cosmas</Navbar.Brand>
            <Navbar.Toggle />
            <Navbar.Collapse>
                <Nav className='me-auto'>
                    <Nav.Link href='#'>Home</Nav.Link>
                    <Nav.Link href='#'>Instructions</Nav.Link>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    );
}

// Main Body content component
const Bodycontent = () => {
    return (
        <div className='container'>
            {/* Total Time and Question Tracker */}
            <div className='row mb-4'>
                <div className='col-lg-6'>
                    <h4>Total Time</h4>
                    <div className='progress'>
                        <div className='progress-bar' role='progressbar' style={{ width: '50%' }}></div>
                    </div>
                </div>
                <div className='col-lg-6'>
                    <h4>Question 0/65</h4>
                </div>
            </div>

            {/* Question Section */}
            <div className='row mb-4'>
                <div className='col-lg-12'>
                    <div className='question-box'>
                        <h3>What is the best database storage?</h3>
                    </div>
                </div>
            </div>

            {/* Answer Options */}
            <div className='row mb'>
                <div className='col-lg-6'>
                    <Button variant='outline-primary' className='btn-block mb-2'>A. RDS</Button>
                </div>
                <div className='col-lg-6'>
                    <Button variant='outline-primary' className='btn-block mb-2'>B. DynamoDB</Button>
                </div>
                <div className='col-lg-6'>
                    <Button variant='outline-primary' className='btn-block mb-2'>C. Aurora</Button>
                </div>
                <div className='col-lg-6'>
                    <Button variant='outline-primary' className='btn-block mb-2'>D. Athena</Button>
                </div>
            </div>

            {/* Submit Button */}
            <div className='row mb-4'>
                <div className='col-lg-12 text-center'>
                    <Button variant='success'>Submit</Button>
                </div>
            </div>

            {/* Question and Answer Review Section */}
            <div className='row'>
                <div className='col-lg-12'>
                    <h4>Question - Answer Review</h4>
                    <ul>
                        <li>A. RDS <span>&#10003;</span></li>
                        <li>B. DynamoDB <span>&#10005;</span></li>
                        <li>C. Aurora <span>&#10005;</span></li>
                        <li>D. Athena <span>&#10005;</span></li>
                    </ul>
                </div>
            </div>
        </div>
    );
}

// App component
function App() {
    return (
        <div className='app'>
            <Nav_bar />
            <Bodycontent />
        </div>
    );
}

export default App;
